package qfpay.wxshop.data.beans;import java.io.Serializable;public class NoticeItemBean implements Serializable {	private static final long serialVersionUID = 1L;	private String created = "";	private String title = "";		private String content = "";	private String link = "";	private String clickable = "";	private String unread = "";	private int type;	private String id = "";	public String getCreated() {		return created;	}	public void setCreated(String created) {		this.created = created;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getContent() {		return content;	}	public void setContent(String content) {		this.content = content;	}	public String getLink() {		return link;	}	public void setLink(String link) {		this.link = link;	}	public String getClickable() {		return clickable;	}	public void setClickable(String clickable) {		this.clickable = clickable;	}	public String getUnread() {		return unread;	}	public void setUnread(String unread) {		this.unread = unread;	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public static long getSerialversionuid() {		return serialVersionUID;	}	public int getType() {		return type;	}	public void setType(int type) {		this.type = type;	}}